"users.documentanalytics.setup.analyticsId.label":{en:"Google Analytics Tracking ID"},"pricing.faq.collaborate.answer":{fr:"Oui. Chaque type de compte vous permet de collaborer et partager avec d'autres utilisateurs. Cependant, chaque collaborateur est sujet aux limites de son propre compte. Par exemple, les utilisateurs de comptes gratuits ne pourront pas diter les documents de plus de 60 objets, mme si le document est cr par un utilisateur avec un compte professionnel. Les comptes d'quipe permettent aux membres de l'quipe de collaborer avec accs  toutes les caractristiques les plus dveloppes.",
en:"Yes. Every account level allows you to collaborate and share with others. However, every collaborator is subject to the limitations of their own account. For example, users on free accounts will not be able to edit documents with over 60 objects, even if the document is created by a user on a Professional account. Team accounts allow team members to collaborate with the full set of premium features.",nl:"Ja. Met elk account kunt u samenwerken en delen met anderen. Echter, iedere medewerker is onderworpen aan de beperkingen van hun eigen account. Bijvoorbeeld, zullen de gebruikers op gratis accounts niet in staat zijn om documenten met meer dan 60 objecten te bewerken, zelfs als het document is gemaakt door een gebruiker op een professioneel account. Met team-accounts kunnen teamleden samenwerken met de volledige set van premium-functies.",
pt:"Sim. Cada nvel de conta permite colaborar e compartilhar com outros. No entanto, cada colaborador est sujeito s limitaes de sua prpria conta. Por exemplo, os usurios de contas gratuitas no podero editar documentos com mais de 60 objetos, mesmo que o documento seja criado por um usurio em uma conta Profissional. Contas de Equipe permitem que os membros da equipe colaborem usando todos os recursos premium.",de:"Ja. Die Zusammenarbeit und das Teilen mit Anderen sind mit jeder Kontenebene mglich. Jeder Mitarbeiter ist jedoch an die Beschrnkungen seines jeweiligen Zugangskontos gebunden. Zum Beispiel knnen Nutzer mit kostenfreiem Zugang keine Dokumente mit ber 60 Objekten bearbeiten, selbst wenn das Dokument von einem Benutzer mit einem professionellen Zugangskonto erstellt wurde. Teamkonten ermglichen Teammitgliedern die Zusammenarbeit mit allen Premiumfeatures.",
es:"S. En todos los niveles de cuenta se puede colaborar y compartir con otros. Sin embargo, cada colaborador est sujeto a las limitaciones de su propia cuenta. Por ejemplo, los usuarios de cuentas gratuitas no podrn editar documentos de ms de 60 objetos, aunque el documento lo haya creado un usuario con cuenta Profesional. En las cuentas de Equipo, los miembros del equipo pueden colaborar con todas las funcionalidades superiores."},"mobile.version.newrequired":{en:"You need to download and install the latest version of the Lucidchart app to access your documents."},
